const Lastname = createContext();

const App = () =>{


    return(
    <>
    <Firstname.provider value={"Abhishek"}>
        <Lastname.provider value={"nayak"}>
            <Comp1/>
        </Lastname.provider>
    </Firstname.provider>
    </>
)
}

export default App;
export {Firstname,Lastname};
